CREATE TABLE app_kpop_group (
  id int(11) UNSIGNED NOT NULL,
  is_collab enum('y','n') COLLATE utf8_unicode_ci NOT NULL DEFAULT 'n',
  name varchar(255) COLLATE utf8_unicode_ci NOT NULL DEFAULT '',
  kname varchar(255) COLLATE utf8_unicode_ci NOT NULL DEFAULT '',
  previous_name varchar(255) COLLATE utf8_unicode_ci NOT NULL DEFAULT '',
  previous_kname varchar(255) COLLATE utf8_unicode_ci NOT NULL DEFAULT '',
  fname varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  alias varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  id_company int(11) UNSIGNED NOT NULL DEFAULT '0',
  members enum('female','male','coed') COLLATE utf8_unicode_ci NOT NULL,
  issolo enum('y','n') COLLATE utf8_unicode_ci NOT NULL DEFAULT 'n',
  id_parentgroup int(11) UNSIGNED NOT NULL DEFAULT '0',
--  `id_currentgroup` int(11) UNSIGNED NOT NULL DEFAULT '0',
--  `id_artist1` int(11) UNSIGNED NOT NULL DEFAULT '0',
--  `id_artist2` int(11) UNSIGNED NOT NULL DEFAULT '0',
--  `id_artist3` int(11) UNSIGNED NOT NULL DEFAULT '0',
--  `id_artist4` int(11) UNSIGNED NOT NULL DEFAULT '0',
  formation mediumint(9) DEFAULT NULL,
  disband mediumint(9) DEFAULT NULL,
  social varchar(512) COLLATE utf8_unicode_ci DEFAULT NULL, 
  id_debut int(11) UNSIGNED DEFAULT NULL,
  debut_date date DEFAULT NULL,
  date_birth date DEFAULT NULL,
  fanclub varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  miak int(11) NOT NULL DEFAULT '0',
  miak_level enum('none','missing','some','complete') COLLATE utf8_unicode_ci NOT NULL DEFAULT 'none',
  sales int(11) NOT NULL DEFAULT '0',
  gaondigital_times int(11) NOT NULL DEFAULT '0',
  gaondigital_firsts int(11) NOT NULL DEFAULT '0',
  yawards varchar(255) COLLATE utf8_unicode_ci DEFAULT '',
  yawards_total int(10) NOT NULL DEFAULT '0',
  yt_followers int(11) NOT NULL DEFAULT '0'
) ENGINE=MyISAM DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

ALTER TABLE app_kpop_group
  ADD PRIMARY KEY (id);

